  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  withRouter,
  Redirect
} from "react-router-dom";

import {
    BoxFooter,
    ContainerFooter,
    RowFooter,
    ColumnFooter,
    HeadingFooter,
    HeadingFooter1,
    ImgagingFooter
  } from "./FooterStyles";


function Footer() {
  return (
    <BoxFooter>
    <ContainerFooter>
    <RowFooter>
      <ColumnFooter>
       <ImgagingFooter src={logosize} alt="Download" />
      </ColumnFooter>
      <ColumnFooter>
        <HeadingFooter>
           Wander Wisely with the PlanetPnP app
        </HeadingFooter>
        <HeadingFooter1>
                &bull; Get helpful alerts about your trips
                <br/>
                &bull; Access all your travel details, even when offline
                <br/> 
                &bull; Categories and recommended tours for art, music, food, sightseeing, historical eventsâ€¦
         </HeadingFooter1>
      </ColumnFooter>
    </RowFooter>
  </ContainerFooter>
  </BoxFooter>
  );
}

export default Footer;
